import './index.css'

export default class Parent extends Component {
  render() {
    return (
      <div className='parent'>
          <h3>我是parent组件</h3>
          <A>hello</A>
      </div>
    )
  }
}

class A extends Component {
    render() {
      return (
        <div className='a'>
            <h3>我是A组件</h3>
            
        </div>
      )
    }
  }

